import { Component } from 'react'

export default class Users extends Component {
    constructor(props) {
        super(props)
        this.state = {
            users: [ 
                {Name: 'Placeholder'},    
                {Name: 'Placeholder'},    
                {Name: 'Placeholder'},    
                {Name: 'Placeholder'},    
            ]
        };

        this.state.rowLength = 4
        
    }
    render() {
        return (
            <div style={{ textAlign: 'center' }}>
                <h1>Usu√°rios inscritos</h1>
                <ul style={{ listStyleType: 'none', display: 'flex',  alignContent: 'center', width: '80%', position: 'relative', left: '20%' }}>
                    { 
                        
                        this.state.users.map((user) => {
                            return (
                                <li style={{ backgroundColor: '#C9DDFF', margin: '10px', padding: '50px' }}>
                                    <h2>{ user.Name }</h2>
                                </li>
                            )
                        })
                    }
                </ul>
            </div>
            )
    }
}
